import classes from './MatchDetails.module.css';
import Tilt from 'react-vanilla-tilt'
import CompareTeam from './CompareTeam';

const MatchDetails = () => {
return (
    <section className={classes.body}>
     <div className={classes.container}>
     <Tilt   className={classes.box}  options={{ speed: 400, max: 25 }}> 
            <h2 className={classes.name}>Team A</h2>
            {/* <a href="#" className={classes.buy}>Buy Now</a> */}
            <div className={classes.circle}></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRb_WM6mx1ViU824UfaLExCk-pJIC3ITPb4kg&usqp=CAU" style={{ '--delay': 1}} className={classes.product}/>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTVlnzjwsEET1ILECT87npfWWCGLXjOnCnNTQ&usqp=CAU"  style={{ '--delay': 2}} className={classes.product}/>

    </Tilt>
    <CompareTeam/>
    <Tilt  className={classes.box} options={{ speed: 400, max: 25 }}> 
            <h2 className={classes.name}>Team B</h2>
            {/* <a href="#" className={classes.buy}>Buy Now</a> */}
            <div className={classes.circle}></div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTST7rLZbI4OcZm1M2t4lG9MmdNFAT-xTiNPA&usqp=CAU" className={classes.product}/>
    </Tilt>
    </div>
   </section>
   )
}

export default MatchDetails;
